using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;

using Android.App;
using Android.Content;
using Android.OS;
using Android.Runtime;
using Android.Views;
using Android.Widget;
using XamSvg;
using Android.Webkit;
using Android.Graphics;

namespace St_Josephs.Droid
{
    [Activity(Label = "Inside", ParentActivity = typeof(Map), Theme = "@style/MapTheme")]
    public class Inside : Activity
    {
        protected override void OnCreate(Bundle bundle)
        {
            base.OnCreate(bundle);

            SetContentView(Resource.Layout.Inside);

            WebView web = FindViewById<WebView>(Resource.Id.web);

            web.LoadUrl("data:image/svg+xml;base64,");
            web.Settings.SetSupportZoom(true);
            web.Settings.DefaultZoom = WebSettings.ZoomDensity.Close;
            web.ZoomBy(0.1f);
            web.Settings.DisplayZoomControls = true;
            web.Settings.BuiltInZoomControls = true;
            web.Settings.UseWideViewPort = true;
            web.Settings.LoadWithOverviewMode = true;
            web.SetBackgroundColor(Color.ParseColor("#2BB673"));
        }
    }
}